import React from 'react';

function PaintingWallFinishes() {
  return (
    <section className="py-20">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold text-center mb-8">Painting & Wall Finishes</h2>
        <img src="https://images.unsplash.com/photo-1583939003579-b80b8c8b6c11" alt="Painting" className="w-full h-96 object-cover rounded-lg mb-8" />
        <p className="text-lg text-center max-w-2xl mx-auto">
          Professional painting and texturing services to refresh your interiors with style and durability.
        </p>
      </div>
    </section>
  );
}

export default PaintingWallFinishes;
